#define MAX_FONT_SIZE_VALUE 8
#define MIN_FONT_SIZE_VALUE 1
#define MAX(x, y) ((x) > (y) ? (x) : (y))
#define MIN(x, y) ((x) < (y) ? (x) : (y))
static inline int adjust_font_size(int font_size) {
    return MIN(MAX(font_size, MIN_FONT_SIZE_VALUE), MAX_FONT_SIZE_VALUE);
}
static inline const unsigned char* get_ascii_image(int font_size, char ch) {
    int adjusted_font_size = adjust_font_size(font_size) * 8;
    unsigned chr = ch < 32 || ch > 126 ? 0 : ch - 32;
    switch (adjusted_font_size) {
        case 8: return ascii_image_8[chr];
        case 16: return ascii_image_16[chr];
        case 24: return ascii_image_24[chr];
        case 32: return ascii_image_32[chr];
        case 40: return ascii_image_40[chr];
        case 48: return ascii_image_48[chr];
        case 56: return ascii_image_56[chr];
        case 64: return ascii_image_64[chr];
        default: return ascii_image_8[chr]; // impossible
    }
}
